import React, { useState, useEffect } from 'react';
import { motion, AnimatePresence } from 'framer-motion';
import { Menu, X, Sparkles, Heart, User, Send, Compass } from 'lucide-react';

const Header = () => {
  const [isMenuOpen, setIsMenuOpen] = useState(false);
  const [isScrolled, setIsScrolled] = useState(false);

  // Handle scroll effect for glass header
  useEffect(() => {
    const handleScroll = () => {
      setIsScrolled(window.scrollY > 20);
    };
    window.addEventListener('scroll', handleScroll);
    return () => window.removeEventListener('scroll', handleScroll);
  }, []);

  // Lock body scroll when menu is open to prevent "ghost scrolling"
  useEffect(() => {
    if (isMenuOpen) {
      document.body.style.overflow = 'hidden';
    } else {
      document.body.style.overflow = 'unset';
    }
  }, [isMenuOpen]);

  const scrollToSection = (sectionId) => {
    const element = document.getElementById(sectionId);
    if (element) {
      // Offset for the fixed header
      const offset = 80;
      const bodyRect = document.body.getBoundingClientRect().top;
      const elementRect = element.getBoundingClientRect().top;
      const elementPosition = elementRect - bodyRect;
      const offsetPosition = elementPosition - offset;

      window.scrollTo({
        top: offsetPosition,
        behavior: 'smooth'
      });
    }
    setIsMenuOpen(false);
  };

  const navItems = [
    { id: 'about', label: 'My Story', icon: User },
    { id: 'philosophy', label: 'Philosophy', icon: Compass },
    { id: 'testimonials', label: 'Testimonials', icon: Heart },
    { id: 'contact', label: 'Get in Touch', icon: Send },
  ];

  return (
    <>
      <motion.header
        className={`fixed top-0 left-0 right-0 z-[100] transition-all duration-500 ${
          isScrolled || isMenuOpen 
            ? 'bg-black/20 backdrop-blur-xl border-b border-white/10 py-4' 
            : 'bg-transparent py-6'
        }`}
        initial={{ y: -100 }}
        animate={{ y: 0 }}
      >
        <div className="container mx-auto px-6 md:px-12">
          <div className="flex items-center justify-between">

            {/* Brand Identity */}
            <div 
              className="flex flex-col cursor-pointer group"
              onClick={() => window.scrollTo({ top: 0, behavior: 'smooth' })}
            >
              <span className="text-xl md:text-2xl font-serif font-bold text-white tracking-tight group-hover:text-orange-500 transition-colors">
                Mamtha Gowda
              </span>
              <div className="flex items-center gap-2">
                <span className="text-[9px] uppercase tracking-[0.4em] text-orange-500 font-black">
                  Life Coach
                </span>
                <div className="h-[1px] w-4 bg-orange-500/30" />
              </div>
            </div>

            {/* Desktop Navigation */}
            <nav className="hidden lg:flex items-center gap-12">
              <ul className="flex items-center gap-10">
                {navItems.map((item) => (
                  <li key={item.id}>
                    <button
                      className="text-[10px] text-gray-400 hover:text-white transition-all font-bold tracking-[0.25em] uppercase relative group"
                      onClick={() => scrollToSection(item.id)}
                    >
                      {item.label}
                      <span className="absolute -bottom-1 left-0 w-0 h-[1px] bg-orange-500 transition-all group-hover:w-full" />
                    </button>
                  </li>
                ))}
              </ul>

              <motion.button
                whileHover={{ scale: 1.05 }}
                whileTap={{ scale: 0.95 }}
                onClick={() => scrollToSection('contact')}
                className="px-8 py-3 bg-white text-black rounded-full text-xs font-black uppercase tracking-widest hover:bg-orange-500 hover:text-white transition-all shadow-2xl shadow-white/5"
              >
                Book a Session
              </motion.button>
            </nav>

            {/* Mobile Menu Button */}
            <button
              className="lg:hidden text-white p-2 transition-transform active:scale-90"
              onClick={() => setIsMenuOpen(!isMenuOpen)}
              aria-label="Toggle Menu"
            >
              {isMenuOpen ? <X size={30} className="text-orange-500" /> : <Menu size={30} />}
            </button>
          </div>
        </div>
      </motion.header>

      {/* Mobile Menu Overlay with Glass Effect */}
      <AnimatePresence>
        {isMenuOpen && (
          <motion.div
            initial={{ opacity: 0 }}
            animate={{ opacity: 1 }}
            exit={{ opacity: 0 }}
            className="fixed inset-0 z-[90] lg:hidden"
          >
            {/* Dark blur background */}
            <div className="absolute inset-0 bg-black/60 backdrop-blur-2xl" onClick={() => setIsMenuOpen(false)} />

            <nav className="relative h-full flex flex-col justify-center px-10">
              <ul className="space-y-10">
                {navItems.map((item, index) => (
                  <motion.li 
                    key={item.id}
                    initial={{ x: -30, opacity: 0 }}
                    animate={{ x: 0, opacity: 1 }}
                    transition={{ delay: index * 0.1 + 0.2 }}
                  >
                    <button
                      className="flex items-center gap-6 text-4xl md:text-5xl font-serif text-white hover:text-orange-500 transition-colors group"
                      onClick={() => scrollToSection(item.id)}
                    >
                      <span className="text-xs font-sans text-orange-500/40 font-black tracking-tighter">0{index + 1}</span>
                      {item.label}
                    </button>
                  </motion.li>
                ))}

                <motion.li
                  initial={{ y: 20, opacity: 0 }}
                  animate={{ y: 0, opacity: 1 }}
                  transition={{ delay: 0.6 }}
                  className="pt-10"
                >
                  <button
                    onClick={() => scrollToSection('contact')}
                    className="w-full py-6 bg-orange-500 text-white rounded-[2rem] font-bold text-xl shadow-2xl shadow-orange-500/20"
                  >
                    Begin Transformation
                  </button>
                </motion.li>
              </ul>
            </nav>
          </motion.div>
        )}
      </AnimatePresence>
    </>
  );
};

export default Header;
